import './App.css';
import FetchData from './fetchData.js';
import asset1 from './asset1.svg'
import RevenueOptimize from './Revenue.js'
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Navbar from 'react-bootstrap/Navbar'
import { ScrollView } from "@cantonjs/react-scroll-view";
import AdSoul from './AdSoul';

function Homepage() {
    return (
        <div className="App">
            <header className="App-header">
                <Container fluid >
                    <Row>
                        <AdSoul></AdSoul>
                        <Col xs={12} md={6}><Container fluid style={{ backgroundColor: 'white', height: '100vh' }}>

                            <Container style={{ padding: '50px 0px 50px 0px', color: 'black', textAlign: 'left' }}>
                                <h1>Apps</h1>
                                <ScrollView style={{ height: '80vh', padding: '10px 0px 0px 0px' }}>
                                    <FetchData></FetchData>
                                </ScrollView>
                            </Container>
                        </Container></Col>
                    </Row>
                </Container>
            </header>
        </div>
    );
}

export default Homepage;
